import styled from "@emotion/styled";

export const Footer = styled.div`
  left: 0;
  bottom: 0;
  width: 100%;
  color: #858585;

  border-top: 0.1rem solid rgba(102, 102, 102, 0.25);
  text-align: center;
  padding-top: 2rem;
  margin-bottom: 2rem;
`;

export const FooterDiv = styled.div`
  left: 0;
  bottom: 0;
  width: 100%;
  text-align: center;
  padding-top: 30rem;
`;
